import React from 'react';
import { useNavigate } from 'react-router-dom';
import Button from 'react-bootstrap/Button'
import { useState, useEffect } from 'react';


const Profile = () => {
    const navigate = useNavigate();
    const [buttonCount, setButtonCount] = useState(1);

    const goToProfile = () => {
        navigate('/Profile');
    };

    useEffect(() => {
        const storedCount = localStorage.getItem('buttonCount');
        if (storedCount) {
            setButtonCount(parseInt(storedCount));
        }
    }, []);

    const handleAddPlan = () => {
        const newCount = buttonCount + 1;
        setButtonCount(newCount);
        localStorage.setItem('buttonCount', newCount.toString());
        navigate('/profile/Add-A-Plan');
    };

    const renderButtons = () => {
        const buttons = [];
        for (let i = 0; i < buttonCount; i++) {
            buttons.push(
                <div key={i} class="flex items-center justify-center h-24 rounded bg-gray-50 dark:bg-gray-800">
                    <Button class="text-2xl text-gray-400 dark:text-gray-500"
                        onClick={handleAddPlan}
                    >
                        <svg class="w-3.5 h-3.5" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 18 18">
                            <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M9 1v16M1 9h16" />
                        </svg>
                    </Button>
                </div>
            );
        }
        return buttons;
    };

    return (
        <div>
            {/* Placeholder for the rest of the content, with padding to offset the fixed navbar */}
            <div className="pt- inset-2">
                <div className="hero bg-blue-500 text-white p-10">
                    <h1 className="text-4xl font-bold">Welcome to your profile!</h1>
                </div>
                <div class="flex">
                    <div class="flex-1">
                        <h1 class="text-xl font-bold p-2">Your plans:</h1>

                        <div class="p-4 sm:ml-64">
                            <div class="p-4 border-2 border-gray-200 border-dashed rounded-lg dark:border-gray-700">
                                <div class="grid grid-cols-3 gap-4 mb-4">
                                    {renderButtons()}
                                </div>
                                <div class="grid grid-cols-2 gap-4">
                                </div>
                            </div>
                        </div>
                    </div>
                    <aside id="default-sidebar" class="fixed top-12.7 left-0 z-40 w-64 h-screen transition-transform -translate-x-full sm:translate-x-0 " aria-label="Sidebar">
                        <div class="h-full px-3 py-4 overflow-y-auto bg-gray-50 dark:bg-gray-800 -10">
                            <ul class="space-y-2 font-medium">
                                <li>
                                    <a href="#" class="flex items-center p-2 text-gray-900 rounded-lg dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700 group">
                                        <svg class="w-5 h-5 text-gray-500 transition duration-75 dark:text-gray-400 group-hover:text-gray-900 dark:group-hover:text-white" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="currentColor" viewBox="0 0 22 21">
                                            <path d="M16.975 11H10V4.025a1 1 0 0 0-1.066-.998 8.5 8.5 0 1 0 9.039 9.039.999.999 0 0 0-1-1.066h.002Z" />
                                            <path d="M12.5 0c-.157 0-.311.01-.565.027A1 1 0 0 0 11 1.02V10h8.975a1 1 0 0 0 1-.935c.013-.188.028-.374.028-.565A8.51 8.51 0 0 0 12.5 0Z" />
                                        </svg>
                                        <span class="ms-3">Dashboard</span>
                                    </a>
                                </li>
                                <li>
                                    <a href="#" class="flex items-center p-2 text-gray-900 rounded-lg dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700 group">
                                        <svg class="flex-shrink-0 w-5 h-5 text-gray-500 transition duration-75 dark:text-gray-400 group-hover:text-gray-900 dark:group-hover:text-white" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="currentColor" viewBox="0 0 20 20">
                                            <path d="M5 5V.13a2.96 2.96 0 0 0-1.293.749L.879 3.707A2.96 2.96 0 0 0 .13 5H5Z" />
                                            <path d="M6.737 11.061a2.961 2.961 0 0 1 .81-1.515l6.117-6.116A4.839 4.839 0 0 1 16 2.141V2a1.97 1.97 0 0 0-1.933-2H7v5a2 2 0 0 1-2 2H0v11a1.969 1.969 0 0 0 1.933 2h12.134A1.97 1.97 0 0 0 16 18v-3.093l-1.546 1.546c-.413.413-.94.695-1.513.81l-3.4.679a2.947 2.947 0 0 1-1.85-.227 2.96 2.96 0 0 1-1.635-3.257l.681-3.397Z" />
                                            <path d="M8.961 16a.93.93 0 0 0 .189-.019l3.4-.679a.961.961 0 0 0 .49-.263l6.118-6.117a2.884 2.884 0 0 0-4.079-4.078l-6.117 6.117a.96.96 0 0 0-.263.491l-.679 3.4A.961.961 0 0 0 8.961 16Zm7.477-9.8a.958.958 0 0 1 .68-.281.961.961 0 0 1 .682 1.644l-.315.315-1.36-1.36.313-.318Zm-5.911 5.911 4.236-4.236 1.359 1.359-4.236 4.237-1.7.339.341-1.699Z" />
                                        </svg>
                                        <span class="flex-1 ms-3 whitespace-nowrap">Plans</span>
                                        <span class="inline-flex items-center justify-center w-3 h-3 p-3 ms-3 text-sm font-medium text-blue-800 bg-blue-100 rounded-full dark:bg-blue-900 dark:text-blue-300">3</span>
                                    </a>
                                </li>
                                <li>
